import React from 'react'
import {View, Text} from 'react-native'

function HomeScreen() {
    return (
        <View style={{flex:1, alignItems:'center', justifyContent:'center'}}>
            <Text>Mess Owner Home Screen</Text>
        </View>
      )
}

export default HomeScreen
